The day is finally here…. our dahlia tuber sale is today at 10am PST. I feel so connected to these flowers, these aren’t just tubers to me. I envisioned & dreamt of this field from the moment we stepped foot onto the property a few years ago & now I’m getting ready to send pieces of my dream out to you. We have worked so incredibly hard to bring this sale to fruition & have done everything we can to prepare for this sale. As the dahlia craze is at an all time high right now I please ask for your patience, understanding & grace today as we navigate this together. I’m not gonna lie I hardly slept last night, staring up into the darkness worrying about things I can’t control. I’m so excited but also a nervous wreck. We are ready & I know it’s going to be a great day. Thank you so much for all the love & support of our little family farm, we truly appreciate each & every one of you. See you soon! 💕
